import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const PoolListPage = () => {
  const [pools, setPools] = useState([]);

  // In a real application, you would fetch pools from an API
  useEffect(() => {
    const fetchPools = async () => {
      // const response = await poolService.getAllPools();
      // setPools(response.data);
      setPools([
        { id: 1, name: 'Pool Alpha', location: 'Zone 1', status: 'Active' },
        { id: 2, name: 'Pool Beta', location: 'Zone 2', status: 'Inactive' },
        { id: 3, name: 'Pool Gamma', location: 'Zone 1', status: 'Active' },
      ]);
    };
    fetchPools();
  }, []);

  const handleDeletePool = (id) => {
    if (window.confirm('Are you sure you want to delete this pool?')) {
      console.log('Deleting pool with ID:', id);
      setPools(pools.filter(pool => pool.id !== id));
      // In a real application, call poolService.deletePool(id);
    }
  };

  const handleTogglePoolStatus = (id) => {
    setPools(pools.map(pool =>
      pool.id === id ? { ...pool, status: pool.status === 'Active' ? 'Inactive' : 'Active' } : pool
    ));
    console.log('Toggling status for pool with ID:', id);
    // In a real application, call poolService.togglePoolStatus(id);
  };

  return (
    <div className="container mx-auto p-4">
      <h2 className="text-2xl font-bold mb-4">Pool List</h2>
      <div className="flex justify-end mb-4">
        <Link to="/pools/create" className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded">
          Create New Pool
        </Link>
      </div>
      {pools.length === 0 ? (
        <p>No pools available.</p>
      ) : (
        <div className="overflow-x-auto">
          <table className="min-w-full bg-white shadow-md rounded-lg overflow-hidden">
            <thead className="bg-gray-200 text-gray-700">
              <tr>
                <th className="py-2 px-4 text-left">ID</th>
                <th className="py-2 px-4 text-left">Name</th>
                <th className="py-2 px-4 text-left">Location</th>
                <th className="py-2 px-4 text-left">Status</th>
                <th className="py-2 px-4 text-left">Actions</th>
              </tr>
            </thead>
            <tbody className="text-gray-600">
              {pools.map((pool) => (
                <tr key={pool.id} className="border-b border-gray-200 hover:bg-gray-100">
                  <td className="py-2 px-4">{pool.id}</td>
                  <td className="py-2 px-4">{pool.name}</td>
                  <td className="py-2 px-4">{pool.location}</td>
                  <td className="py-2 px-4">
                    <span className={`px-2 inline-flex text-xs leading-5 font-semibold rounded-full ${pool.status === 'Active' ? 'bg-green-100 text-green-800' : 'bg-red-100 text-red-800'}`}>
                      {pool.status}
                    </span>
                  </td>
                  <td className="py-2 px-4 flex space-x-2">
                    <Link
                      to={`/pools/edit/${pool.id}`}
                      className="bg-yellow-500 hover:bg-yellow-700 text-white font-bold py-1 px-3 rounded text-xs"
                    >
                      Edit
                    </Link>
                    <button
                      onClick={() => handleTogglePoolStatus(pool.id)}
                      className={`${pool.status === 'Active' ? 'bg-red-500 hover:bg-red-700' : 'bg-green-500 hover:bg-green-700'} text-white font-bold py-1 px-3 rounded text-xs`}
                    >
                      {pool.status === 'Active' ? 'Deactivate' : 'Activate'}
                    </button>
                    <button
                      onClick={() => handleDeletePool(pool.id)}
                      className="bg-gray-500 hover:bg-gray-700 text-white font-bold py-1 px-3 rounded text-xs"
                    >
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default PoolListPage;
